--CREATE DATABASE LibraryManagement
GO
USE LibraryManagement
GO
CREATE TABLE dbo.Account
(
	TenDangNhap varchar(32) NOT NULL,
	MatKhau varchar(32) NOT NULL,
	LanCuoiHoatDong datetime NULL,
	MaNhanVien nvarchar(10) NOT NULL,
	PRIMARY KEY (TenDangNhap)
)
GO
CREATE TABLE dbo.RecordedLog
(
	LogID nvarchar(20) NOT NULL,
	TenDangNhap varchar(32) NOT NULL,
	ThoiGian datetime NULL,
	MoTa nvarchar(1000) NULL,
	PRIMARY KEY (LogID)
)
GO
CREATE TABLE dbo.TacGia
(
	MaSach nvarchar(10) NOT NULL,
	TenTacGia nvarchar(30) NOT NULL,
	PRIMARY KEY (MaSach,TenTacGia)
)
GO
CREATE TABLE dbo.CuonSach
(
	MaSach nvarchar(10) NOT NULL,
	MaCuon nvarchar(10) NOT NULL,
	TinhTrangSach nvarchar(15) NULL,
	DoMoiCuaSach nvarchar(5) NULL,
	GiaMua money NULL,
	GiaThue money NULL,
	KeSach int NULL,
	Tang int NULL,
	PRIMARY KEY (MaCuon)
)
GO
CREATE TABLE dbo.DauSach
(
	MaSach nvarchar(10) NOT NULL,
	TuaSach nvarchar(100) NOT NULL,
	MaNXB nvarchar(10) NOT NULL,
	NgonNgu nvarchar(20) NULL,
	TheLoai nvarchar(20) NULL,
	ThoiGianMuonToiDa int NULL,
	PRIMARY KEY (MaSach)
)
GO
CREATE TABLE dbo.KhachHang
(
	MaKhach nvarchar(10) NOT NULL,
	TenKhach nvarchar(30) NOT NULL,
	Email nvarchar(30) NOT NULL,
	DiaChiKhach nvarchar(60) NULL,
	DienThoaiKhach nvarchar(10) NULL,
	PRIMARY KEY (MaKhach)
)
GO
CREATE TABLE dbo.ChiTietDonMuon
(
	MaDonMuon nvarchar(10) NOT NULL,
	MaCuon nvarchar(10) NOT NULL,
	PRIMARY KEY (MaDonMuon,MaCuon)
)
GO
CREATE TABLE dbo.DonMuon
(
	MaDonMuon nvarchar(10) NOT NULL,
	MaNhanVien nvarchar(10) NOT NULL,
	MaKhach nvarchar(10) NOT NULL,
	NgayMuon datetime NOT NULL,
	PRIMARY KEY (MaDonMuon)
)
GO
CREATE TABLE dbo.NXB
(
	MaNXB nvarchar(10) NOT NULL,
	TenNXB nvarchar(50) NOT NULL,
	PRIMARY KEY (MaNXB)
)
GO
CREATE TABLE dbo.ChiTietDonTra
(
	MaDonTra nvarchar(10) NOT NULL,
	MaCuon nvarchar(10) NOT NULL,
	NgayTra datetime NOT NULL,
	TienPhat money NOT NULL,
	PRIMARY KEY (MaDonTra, MaCuon)
)
GO
CREATE TABLE dbo.DonTra
(
	MaDonTra nvarchar(10) NOT NULL,
	MaDonMuon nvarchar(10) NOT NULL,
	PRIMARY KEY (MaDonTra)
)
GO
CREATE TABLE dbo.NhanVien
(
	MaNhanVien nvarchar(10) NOT NULL,
	TenNhanVien nvarchar(30) NOT NULL,
	NgaySinh datetime NOT NULL,
	CMND nvarchar(12) NULL,
	GioiTinh nvarchar(6) NULL,
	EmailNhanVien nvarchar(30) NOT NULL,
	DiaChi nvarchar(60) NULL,
	SDT nvarchar(10) NULL,
	ChucVu nvarchar(10) NULL,
	PRIMARY KEY (MaNhanVien)
)
GO
